import React from 'react';
import Link from 'next/link'

import {Head} from './styles'

const Header = () => {
  return (
    <Head>
      <Link href="/">
        <a><img src='./images/logo.png' /></a>
      </Link>
    </Head>
  );
};

export default Header;
